import React, { useState } from 'react';
import {
  View,
  Button,
  Text,
  TextInput,
  TouchableOpacity,
  CheckBox,
  ScrollView,
  StyleSheet
} from 'react-native';

const SurveyPage = ({ navigation }) => {
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [isUnder18, setIsUnder18] = useState(false);
  const [occupation, setOccupation] = useState('');
  const [income, setIncome] = useState('');
  const [showResults, setShowResults] = useState(false);

  const handleSurveySubmit = () => {
    // Logic to handle the survey submission and show results
    setShowResults(true);
  };

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <View style={styles.nav}>
        <Button
          title="Survey"
          color="black"
          onPress={() => navigation.navigate('Survey')}
        />
        <Button
          title="Information"
          color="black"
          onPress={() => navigation.navigate('Information')}
        />
        <Button
          title="Tax Fraud"
          color="black"
          onPress={() => navigation.navigate('TaxFraud')}
        />
        <Button
          title="About Us"
          color="black"
          onPress={() => navigation.navigate('AboutUs')}
        />
      </View>

      <Text style={styles.header}>Tax Survey</Text>

      <Text style={styles.label}>Name:</Text>
      <TextInput
        style={styles.input}
        placeholder="Please enter your name"
        onChangeText={text => setName(text)}
        value={name}
      />

      <Text style={styles.label}>Age:</Text>
      <TextInput
        style={styles.input}
        placeholder="Please enter your age"
        onChangeText={text => setAge(text)}
        value={age}
        keyboardType="numeric"
      />

      <View style={styles.checkboxContainer}>
        <CheckBox
          value={isUnder18}
          onValueChange={value => setIsUnder18(value)}
        />
        <Text>Are you under 18?</Text>
      </View>

      {!isUnder18 && (
        <View>
          <Text style={styles.label}>Occupation:</Text>
          <View style={styles.checkboxGroup}>
            <CheckBox
              style={styles.checkbox}
              value={occupation === 'student'}
              onValueChange={() => setOccupation('student')}
            />
            <Text>Student</Text>
            <CheckBox
              style={styles.checkbox}
              value={occupation === 'other'}
              onValueChange={() => setOccupation('other')}
            />
            <Text>Other</Text>
          </View>

          {occupation === 'student' && (
            <View>
              {/* Ask about student loans */}
            </View>
          )}

          {occupation === 'other' && (
            <View>
              {/* Display general info for other occupation */}
            </View>
          )}

          {occupation === 'employed' && (
            <View>
              <Text style={styles.label}>Income:</Text>
              <View style={styles.checkboxGroup}>
                <CheckBox
                  style={styles.checkbox}
                  value={income === 'likelyTaxFiles'}
                  onValueChange={() => setIncome('likelyTaxFiles')}
                />
                <Text>Likely to file taxes</Text>
                <CheckBox
                  style={styles.checkbox}
                  value={income === 'notLikelyTaxFiles'}
                  onValueChange={() => setIncome('notLikelyTaxFiles')}
                />
                <Text>Not likely to file taxes</Text>
              </View>
            </View>
          )}
        </View>
      )}

      <TouchableOpacity style={styles.button} onPress={handleSurveySubmit}>
        <Text style={styles.buttonText}>Submit Survey</Text>
      </TouchableOpacity>

      {showResults && (
        <View>
          {/* Display tax filing obligation message + resources - whatever else we want */}
        </View>
      )}
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    padding: 16,
    backgroundColor: '#f7f7f7',
  },
  header: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  label: {
    fontSize: 16,
    fontWeight: 'bold',
    marginBottom: 5,
  },
  input: {
    height: 40,
    borderColor: '#ccc',
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
    borderRadius: 5,
  },
  checkboxContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 10,
  },
  checkboxGroup: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 10,
  },
  checkbox: {
    marginRight: 5,
  },
  nav: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    marginTop: 20,
    marginBottom: 10,
  },
  button: {
    backgroundColor: '#007bff',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 8,
    marginTop: 20,
  },
  buttonText: {
    color: 'white',
    fontSize: 16,
    fontWeight: 'bold',
    textAlign: 'center',
  },
});

export default SurveyPage;
